import Link from 'next/link';
import Fade from 'react-reveal/Fade';

const Projects = () =>{
    return(
        <div id="projects" className="projects-section">
        <Fade bottom>
            <div className="projects-container">
            <div className="projects-card">
                <h1>iFavorites</h1>
                <p>App using React-Express-Node and iTunes Search API</p>
                <img src="/static/iTunes.png" className="project-image" />
                <Link href="https://serene-meadow-48919.herokuapp.com/"><i className="fas fa-link fa-3x"></i></Link>
                <Link href="https://github.com/moralesmiguel/iFavorites"><i className="fab fa-github fa-3x"></i></Link>
            </div>
            <div className="projects-card">
                <h1>MERN Car Database</h1>
                <p>App that provides an interface for CRUD operations on a MongoDB database</p>
                <img src="/static/merncar.png" className="project-image" />
                <Link href="https://github.com/moralesmiguel/MERN-Car-CRUD"><i className="fab fa-github fa-3x"></i></Link>
            </div>
            </div>
        </Fade>
        </div>
    );
}

export default Projects;
